import React, {useState, useMemo} from 'react';

export default class Table extends Component{

	render(){
		var info = this.props.data;
		//console.log("info",info);
		let showData;

		if(typeof(info) == "object" && info != "undefined") {
			showData = Object.keys(info).map((data,key) => {
				return(
					<tr key={key}>
						<td>{info[key].id}</td>
						<td>{info[key].title}</td>
						<td>{info[key].completed}</td>
						<td>
							<button>Delete</button>
						</td>
					</tr>
				)
			})
		}

		return(
			<table className="table table-bordered">
			    <thead>
			      <tr>
			      	<th>id</th>
			        <th>Title</th>
			        <th>Completed</th>
			        <th>Action</th>
			      </tr>
			    </thead>
			    <tbody>
			    	{showData}
			    </tbody>
			  </table>
		)
	}
}
